public class Program17 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// wap to print all numbers between 30 to 50 those are not divisible by 7.

		for (int i = 30; i <= 50; i++) {
			if (i % 7 != 0) {
				System.out.print(i + " ");
			}
		}
	}

}
